import React, { usetState, useEffect, useState } from "react";
import {
  Button,
  Form as FormStrap,
  FormGroup,
  Label,
  Input,
  FormText,
  Container,
  Row,
  Col
} from "reactstrap";

function Form(props) {
  const [teamMember, setTeamMember] = useState({
    name: "",
    email: "",
    role: ""
  });

  const handleChange = event => {
    setTeamMember({ ...teamMember, [event.target.id]: event.target.value });
  };

  return (
    <Container>
      <FormStrap>
        <Row>
          <Col>
            <FormGroup>
              <Label for="name">Name</Label>
              <Input
                id="name"
                type="text"
                value={teamMember.name}
                onChange={handleChange}
              />
            </FormGroup>
          </Col>
          <Col>
            <FormGroup>
              <Label for="email">Email</Label>
              <Input
                id="email"
                type="email"
                value={teamMember.email}
                onChange={handleChange}
              />
            </FormGroup>
          </Col>
          <Col>
            <FormGroup>
              <Label for="role">Role</Label>
              <Input
                id="role"
                type="text"
                value={teamMember.role}
                onChange={handleChange}
              />
            </FormGroup>
          </Col>
        </Row>
        <Button outline color="primary">
          Submit
        </Button>
      </FormStrap>
    </Container>
  );
}

export default Form;
